// src/pages/admin/UserManagementPage.tsx

// src/pages/admin/UserManagementPage.tsx

import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { User } from '../../models/User';
import UserList from '../../components/UserList';
import {
  Container,
  Button,
  CircularProgress,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  IconButton,
  Pagination,
  TextField,
  Typography,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';

const UserManagementPage: React.FC = () => {
  const [users, setUsers] = useState<User[]>([]);
  const [selectedUser, setSelectedUser] = useState<User | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [loading, setLoading] = useState<boolean>(false);
  const [openDialog, setOpenDialog] = useState<boolean>(false);
  const [currentPage, setCurrentPage] = useState<number>(1);
  const [usersPerPage] = useState<number>(5);

  useEffect(() => {
    fetchUsers();
  }, [currentPage]);

  const fetchUsers = async () => {
    setLoading(true);
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        throw new Error('Token no encontrado');
      }
      const response = await axios.get('http://localhost:5000/api/users', {
        headers: { Authorization: `Bearer ${token}` },
      });
      // Ordenar usuarios por fecha de creaciÃ³n en orden descendente
      const sortedUsers = response.data.sort(
        (a: User, b: User) => new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime()
      );

      setUsers(sortedUsers);
      setError(null);
    } catch (error: any) {
      setError('Error al obtener usuarios: ' + (error.message || error));
      console.error('Error al obtener usuarios:', error.message || error);
    } finally {
      setLoading(false);
    }
  };

  const handleDeleteUser = async (userId: string) => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        throw new Error('Token no encontrado');
      }
      await axios.delete(`http://localhost:5000/api/users/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(users.filter(user => user._id !== userId));
      setError(null);
    } catch (error: any) {
      setError('Error al eliminar usuario: ' + (error.message || error));
      console.error('Error al eliminar usuario:', error.message || error);
    }
  };

  const handleOpenDialog = (user?: User | null) => {
    setSelectedUser(user || null);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedUser(null);
  };

  const handlePageChange = (event: React.ChangeEvent<unknown>, page: number) => {
    setCurrentPage(page);
  };

  const paginatedUsers = users.slice((currentPage - 1) * usersPerPage, currentPage * usersPerPage);

  return (
    <Container maxWidth="lg" style={{ marginTop: 20 }}>
      <Typography variant="h3" gutterBottom>
        AdministraciÃ³n de Usuarios
      </Typography>
      {error && <Typography color="error">{error}</Typography>}
      {loading ? (
        <CircularProgress />
      ) : (
        <>
          <UserList
            users={paginatedUsers}
            onDelete={handleDeleteUser}
            onEdit={handleOpenDialog}
            onView={handleOpenDialog}
          />
          <Pagination
            count={Math.ceil(users.length / usersPerPage)}
            page={currentPage}
            onChange={handlePageChange}
            color="primary"
            sx={{ mt: 2 }}
          />
        </>
      )}
      <Dialog open={openDialog} onClose={handleCloseDialog}>
        <DialogTitle>{selectedUser ? 'Ver Perfil del Usuario' : 'Crear Usuario'}</DialogTitle>
        <DialogContent>
          {selectedUser && (
            <>
              <TextField
                margin="dense"
                label="Nombre de Usuario"
                type="text"
                fullWidth
                value={selectedUser.username}
                InputProps={{
                  readOnly: true,
                }}
              />
              <TextField
                margin="dense"
                label="Email"
                type="email"
                fullWidth
                value={selectedUser.email}
                InputProps={{
                  readOnly: true,
                }}
              />
              <TextField
                margin="dense"
                label="Fecha de CreaciÃ³n"
                type="text"
                fullWidth
                value={new Date(selectedUser.createdAt).toLocaleDateString()}
                InputProps={{
                  readOnly: true,
                }}
              />
            </>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog} color="primary">
            Cerrar
          </Button>
        </DialogActions>
      </Dialog>
    
    </Container>
  );
};

export default UserManagementPage;
